"use strict";

const WIDTH = 640;
const HEIGHT = 480;
const HALF_HEIGHT = HEIGHT / 2;
const ASPECT_RATIO = WIDTH / HEIGHT;

let canvas = document.getElementById("canvas3d");
canvas.width = WIDTH;
canvas.height = HEIGHT;
let context = canvas.getContext("2d");

setInterval(draw, 30);

let screen = context.createImageData(WIDTH, HEIGHT);
let screenPixels = screen.data;

// Image transformation
let drawSize = 2.5;
let centerX = 0.0;
let centerZ = 7.5;
let theta = 0.0;

// Perspective projection
let fov = 60.0;
fov *= Math.PI / 180.0;
let perspective = Math.tan(fov / 2.0);

function draw() {
	// Clear screen
	for (let y = 0; y < HEIGHT; y++) {
		for (let x = 0; x < WIDTH; x++) {
			let loc = 4 * (x + y * WIDTH);
			screenPixels[loc] = 0;
			screenPixels[loc+1] = 0;
			screenPixels[loc+2] = 0;
			screenPixels[loc+3] = 255;
		}
	}

	theta += 0.04;
	centerX = 2 * Math.sin(theta * 0.5);
	let rightX = Math.cos(theta) * drawSize + centerX;
	let rightZ = Math.sin(theta) * drawSize + centerZ;
	let leftX = 2 * centerX - rightX;
	let leftZ = 2 * centerZ - rightZ;
	let rightY = drawSize;
	let leftY = drawSize;

	rightX /= perspective * rightZ;
	rightY /= perspective * rightZ;
	leftX /= perspective * leftZ;
	leftY /= perspective * leftZ;

	// Put left/right on correct sides with swap
	let shouldSwap = leftX > rightX;
	if (shouldSwap) {
		let tempX = leftX;
		leftX = rightX;
		rightX = tempX;

		let tempY = leftY;
		leftY = rightY;
		rightY = tempY;

		let tempZ = leftZ;
		leftZ = rightZ;
		rightZ = tempZ;
	}


	// Sc postfix = screen/pixel coordinates, Nm postfix = normalized coordinates
	let leftXSc = (leftX + ASPECT_RATIO) * HALF_HEIGHT;
	let leftYSc = (-leftY + 1.0) * HALF_HEIGHT;
	let rightXSc = (rightX + ASPECT_RATIO) * HALF_HEIGHT;
	let rightYSc = (-rightY + 1.0) * HALF_HEIGHT;

	let xDiffSc = rightXSc - leftXSc;
	let yDiffSc = rightYSc - leftYSc;
	let startXSc = Math.round(leftXSc);
	let initialStepXSc = (startXSc + 0.5 - leftXSc);
	let endXSc = Math.round(rightXSc);
	let stepT = 1 / xDiffSc;
	let initialStepT = initialStepXSc * stepT;

	let stepYSc = yDiffSc / xDiffSc;
	let startYSc = leftYSc + stepYSc * initialStepXSc;
	let endYSc = HEIGHT - startYSc;

	let oneOverLeftZ = 1/leftZ;
	let oneOverRightZ = 1/rightZ;
	let stepInvZ = (oneOverRightZ - oneOverLeftZ) * stepT;
	let initialStepInvZ = stepInvZ * initialStepT;
	let invZ = oneOverLeftZ + initialStepInvZ;
	let xDiffNm = rightX - leftX;
	let startXNm = leftX + initialStepT * xDiffNm;
	let stepUOverZ = stepT * oneOverRightZ;
	let initialStepUOverZ = initialStepT * oneOverRightZ;
	let uOverZ = initialStepUOverZ;

	let pixelColor = { r: 0, g: 0, b: 0 };
	for (let x = startXSc; x < endXSc; x++) {
		let startYRd = Math.round(startYSc);
		let endYRd = Math.round(endYSc);
		let initialStepYSc = startYRd + 0.5 - startYSc;

		let stepV = 1.0 / (HEIGHT - 2 * startYSc);
		let v = initialStepYSc * stepV;
		for (let y = startYRd; y < endYRd; y++) {
			let u = uOverZ / invZ;
			if (shouldSwap) u = 1 - u;
			cat.rgb(u, v, pixelColor);

			let loc = 4 * (x + y * WIDTH);
			screenPixels[loc] = pixelColor.r;
			screenPixels[loc+1] = pixelColor.g;
			screenPixels[loc+2] = pixelColor.b;

			v += stepV;
		}

		startYSc += stepYSc;
		endYSc = HEIGHT - startYSc;
		invZ += stepInvZ;
		uOverZ += stepUOverZ;
	}

	context.putImageData(screen, 0, 0);
}

let Texture = {
	create: function(width, height, data) {
		return {
			width: width,
			height: height,
			data: data,

			rgb: function(u, v, colorIn) {
				let x = Math.min(Math.floor(u * this.width), this.width);
				let y = Math.min(Math.floor(v * this.height), this.height);
				let loc = 3 * (x + y * this.width);

				colorIn.r = this.data[loc];
				colorIn.g = this.data[loc+1];
				colorIn.b = this.data[loc+2];
			}
		};
	}
}

